import React from 'react';

function WorkExperience() {
  return (
    <div className="column-list">
      <div style={{ width: '50%' }} className="column">
        <h2>Work Experience</h2>
        <p>
          <strong>CrossAngle | </strong><em>Blockchain Partner Researcher</em>
        </p>
        <ul className="bulleted-list">
          <li style={{ listStyleType: 'disc' }}>CrossAngle content</li>
        </ul>
        <p>
          <strong>FourPillars</strong> <strong>|</strong> <em>Blockchain Partner Researcher</em>
        </p>
        <ul className="bulleted-list">
          <li style={{ listStyleType: 'disc' }}>FourPillars content</li>
        </ul>
      </div>
    </div>
  );
}

export default WorkExperience;
